import React from "react";

export default function Two() {
  return (
    <div>
      <div className="justify-center flex flex-col">
        <span className="text-6xl mt-16 w-full  font-meduim bg-red-50  flex text-center">
          Nous aidons les marques à <br />
          être plus performante & impactante
        </span>
        <span></span>
      </div>
    </div>
  );
}
